      <div>
        <h2> login page </h2>
        <input type="text" style={{ margin: 5 }} onChange={this.chgEmail} placeholder="insert your email" /><br />
        <input type="text" style={{ margin: 5 }} onChange={this.chgPass} placeholder="insert your pass" />
      </div>
    );
  }
}
